import React from "react";
// import { IconName } from "react-icons/ci";
import "../Assets/css/AccueilContenue.css";
import MyHeader from "./MyHeader.tsx";

function AccueilContenue(){
    return (
      <>

        <div className="banniere">
          <div className="filtre">
            <div className="textAcc">
              <h1>
                Véhicules d'Exception <br></br>
                Découvrez Notre Sélection
              </h1>
              <p>
                Bienvenue sur Buy Car, votre destination ultime pour trouver la
                voiture de vos rêves ! <br />
                Que vous soyez à la recherche d'une voiture d'occasion fiable,
                d'une voiture neuve dernier cri ou simplement à la recherche
                d'inspiration, vous êtes au bon endroit.
              </p>
            </div>
            <div className="buttAcc">Se connecter</div>
          </div>
        </div>

        <div className="contenueAcc">
          <div className="contenueAccGauche">
            {/* <p>jhdkzhd</p> */}
            <div className="titreCont">
              <p>Trouvez votre voiture</p>
            </div>
            <div className="selectCat">
              <h2>Categorie</h2>
              <div onClick={()=>{
                var div = document.querySelector(".allcatselect");
                if (div!=null) {
                  div.style.display = 'flex';
                  let act = document.getElementById('action');
                  act.textContent = '-';
                  console.log("ddd");
                // cat = true;
                }
                // }if (div.style.display!='none'&&div!=null) {
                //   div.style.display = 'none';
                //   let act = document.getElementById('action');
                //   act.textContent = '+';
                //   console.log("ggg")
                //   // cat = false;
                // }
                
              }} className="buttKely"><p id="action">+</p></div>
              <div className="allcatselect">
                <p>
                  <a href="" className="carrebox"></a>
                  4x4
                </p>
                <p>
                  <a href="" className="carrebox"></a>
                  4x4
                </p>
                <p>
                  <a href="" className="carrebox"></a>
                  4x4
                </p>
                <p>
                  <a href="" className="carrebox"></a>
                  4x4
                </p>
                <p>
                  <a href="" className="carrebox"></a>
                  4x4
                </p>
                <p>
                  <a href="" className="carrebox"></a>
                  4x4
                </p>
                <p>
                  <a href="" className="carrebox"></a>
                  4x4
                </p>
                <p>
                  <a href="" className="carrebox"></a>
                  4x4
                </p>
                <p>
                  <a href="" className="carrebox"></a>
                  4x4
                </p>
              </div>
            </div>
          </div>
          <div className="contenueAccDroite"></div>
        </div>
        {/* <p>Coucou</p> */}
        {/* <div>
          <h1>khdkqhd</h1>
        </div> */}
      </>
    );
  }


export default AccueilContenue;
